    method: POST
    uri: https://management.azure.com/subscriptions/00000000-0000-0000-0000-000000000000/resourceGroups/cli_test_vpn_connection_ipsec000001/providers/Microsoft.Network/connections/conn1/vpndeviceconfigurationscript?api-version=2023-09-01
  response:
    body:
      string: '"\r\n! Microsoft Corporation\r\n! --------------------------------------------------------------------------------------------------------------------------------------------\r\n!
        Generic configuration templates\r\n!\r\n! DISCLAIMER : THIS IS A SAMPLE CONFIGURATION
        SCRIPT OFFERED BY MICROSOFT FOR YOUR 3RD PARTY DEVICE. IF YOU NEED \r\n!\t\t\t   HANDS-ON
        SUPPORT OR FURTHER ASSISTANCE, PLEASE CONTACT YOUR VENDOR DIRECTLY.\r\n!\r\n!
        This configuration template shows all the VPN configuration parameters associated
        with your S2S VPN connection.\r\n! The script you need to copy onto your Cisco
        ISR SRX (IOS 15.2+) to setup a RouteBased IKEv2 VPN Tunnel to Azure (with
        BGP) is found below [#11]\r\n! --------------------------------------------------------------------------------------------------------------------------------------------\r\n\r\n!
        [1] Resource names\r\n!     CONNECTION NAME\t\t\t: This field is the name
        of your connection resource\r\n!     VIRTUAL NETWORK GATEWAY\t: The name of
        your Azure VPN gateway resource for the connection\r\n!     LOCAL NETWORK
        GATEWAY\t\t: The name of your local network gateway resource for the connection\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n/Data/CONNECTION_NAME
        = conn1\r\n/Data/VNG_NAME        = f8bf0031-cddd-4dd0-9992-615130802f87\r\n/Data/LNG_NAME        =
        lgw1\r\n\r\n! [2] Public IP address of the Azure VPN gateway\r\n!     Active-Standby
        VPN gateway (single public IP address)\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n/Data/VNG_GATEWAYIP   =
        13.64.139.188\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n!     Active-Active
        VPN gateway (A/A mode if more than one public IP is listed below)\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n\r\n/Data/VNG_GATEWAYIPS/IpAddress/IP
        = 13.64.139.188\r\n\r\n! [3] Public IP address of the on-premises VPN device\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n/Data/LNG_GATEWAYIP   =
        131.107.72.22\r\n\r\n\r\n! [4] VNet address prefixes: a list of all VNet address
        prefixes in different formats\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n\r\n/Data/VnetSubnets/Subnet/SP_NetworkIpRange
        = 10.11.0.0\r\n  SP_NetworkSubnetMask   = 255.255.0.0\r\n  SP_NetworkWildcardBits
        = 0.0.255.255\r\n  SP_NetworkCIDR         = 10.11.0.0/16\r\n  SP_TunnelName          =
        SP_TunnelName\r\n/Data/VnetSubnets/Subnet/SP_NetworkIpRange = 10.12.0.0\r\n  SP_NetworkSubnetMask   =
        255.255.0.0\r\n  SP_NetworkWildcardBits = 0.0.255.255\r\n  SP_NetworkCIDR         =
        10.12.0.0/16\r\n  SP_TunnelName          = SP_TunnelName\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n\r\n\r\n!
        [5] On-premises address prefixes: a list of all on-premises address prefixes
        defined in LNG\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n\r\n/Data/OnPremiseSubnets/Subnet/SP_NetworkIpRange
        = 10.61.0.0\r\n  SP_NetworkSubnetMask   = 255.255.0.0\r\n  SP_NetworkWildcardBits
        = 0.0.255.255\r\n  SP_NetworkCIDR         = 10.61.0.0/16\r\n  SP_TunnelName          =
        SP_TunnelName\r\n/Data/OnPremiseSubnets/Subnet/SP_NetworkIpRange = 10.62.0.0\r\n  SP_NetworkSubnetMask   =
        255.255.0.0\r\n  SP_NetworkWildcardBits = 0.0.255.255\r\n  SP_NetworkCIDR         =
        10.62.0.0/16\r\n  SP_TunnelName          = SP_TunnelName  \r\n\r\n! [6] Phase
        1/Main Mode:\r\n!     IKE encryption algorithm\r\n!     IKE hashing algorithm\r\n!     IKE
        Diffie-Hellman group\r\n!     IKE SA lifetime (seconds)\r\n!     IKE SA data
        size (Kilobytes)\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n/Data/IKE_ENCRYPTION_1
        = AES256\r\n/Data/IKE_INTEGRITY_1  = SHA256\r\n/Data/IKE_DHGROUP_1    = DHGroup2\r\n/Data/IKE_SALIFETIME_1
        = 28800\r\n\r\n! [7] Phase 2/Quick Mode:\r\n!     IPsec encryption algorithm\r\n!     IPsec
        hashing algorithm\r\n!     PFS Group (Perfect Forward Secrecy)\r\n!     IPsec
        SA (QMSA) lifetime (seconds)\r\n!     IPsec SA (QMSA) lifetime (kilobytes)\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n/Data/IPsec_ENCRYPTION_1
        \t= AES256\r\n/Data/IPsec_INTEGRITY_1  \t= SHA256\r\n/Data/IPsec_PFSGROUP_1   \t=
        None\r\n/Data/IPsec_SALIFETIME   \t= 3600\r\n/Data/IPsec_KB_SALIFETIME   =
        102400000\r\n\r\n! [8] Connection pre-shared key\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n/Data/CONNECTION_PSK
        = AzureA1b2C3\r\n\r\n! [9] BGP parameters - Azure VPN gateway\r\n!     Enable
        BGP\r\n!     BGP ASN for Azure VPN gateway\r\n!     BGP speaker IP address
        for the Azure VPN gateway\r\n!     BGP peer IP address(es)\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n/Data/CONNECTION_BGP_ENABLED  =
        False\r\n/Data/VNG_ASN                 = VNG_ASN\r\n/Data/VNG_BGPIP               =
        VNG_BGPIP\r\n\r\n! [10] BGP parameters - on-premises network / LNG\r\n!      BGP
        ASN for the on-premises network\r\n!      BGP speaker IP address for the on-premises
        network\r\n!\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n/Data/LNG_ASN                =
        LNG_ASN\r\n/Data/LNG_BGPIP              = LNG_BGPIP\r\n!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n\r\n\r\n!
        [11] Misc\r\n! NOTE: REPLACE these miscellaneous variables on the script below
        values as necessary, some devices may have overlapping identifiers for other
        pre-configured VPN tunnels/policies\r\n!=================================================================================\r\n/Data/AccessList\t\t\t\t=
        Azure-ACL-conn1\r\n/Data/Outside_Interface_Name \t= GigabithEthernet0/0 \r\n/Data/Inside_Interface_Name\t\t=
        GigabithEthernet0/1 \r\n!=================================================================================\r\n\r\n!
        ---------------------------------------------------------------------------------------------------------------------\r\n!
        ACL rules\r\n! \r\n! Some VPN devices require explicit ACL rules to allow
        cross-premises traffic towards Azure:\r\n\r\n! Ensure all the lines below
        under the network objects are single-spaced.\r\n\r\nobject-group network AzureNetworks\r\n
        description Azure-Virtual-Networks\r\n\r\nnetwork-object 10.11.0.0 255.255.0.0
        \r\nnetwork-object 10.12.0.0 255.255.0.0 \r\nexit\r\n\r\nobject-group network
        OnpremisesNetworks\r\n description Onpremises-Networks\r\n\r\nnetwork-object
        10.61.0.0 255.255.0.0 \r\nnetwork-object 10.62.0.0 255.255.0.0 \r\nexit\r\n\r\naccess-list
        Azure-ACL-conn1 permit 13.64.139.188 log\r\naccess-list Azure-ACL-conn1 permit
        object-group AzureNetworks log \r\naccess-list Azure-ACL-conn1 permit object-group
        OnpremisesNetworks log\r\n\r\n! ---------------------------------------------------------------------------------------------------------------------\r\n!
        IKEv2 PROPOSAL\r\n\r\ncrypto ikev2 proposal azure-proposal-conn1\r\n encryption
        aes-cbc-256 aes-cbc-128\r\n integrity sha1 sha256\r\n group 2\r\n!\r\n!\r\n\r\n!
        ---------------------------------------------------------------------------------------------------------------------\r\n!
        IKEv2 POLICY\r\n\r\ncrypto ikev2 policy azure-policy-conn1\r\n proposal azure-proposal-conn1\r\n!\r\n!\r\n\r\n!
        ---------------------------------------------------------------------------------------------------------------------\r\n!
        IKEv2 KEYRING (PRE-SHARED KEY)\r\n\r\ncrypto ikev2 keyring azure-keyring-conn1\r\n
        peer 13.64.139.188\r\n  address 13.64.139.188\r\n  pre-shared-key AzureA1b2C3\r\n
        !\r\n!\r\n!\r\n\r\n! ---------------------------------------------------------------------------------------------------------------------\r\n!
        IKEv2 PROFILE \r\n! NOTE: Interface ''GigabitEthernet0/0'' was picked as the
        LAN interface where on-Premises networks are connected.\r\n!\t\tREPLACE as
        needed.\r\n\r\ncrypto ikev2 profile azure-profile-conn1\r\n match address
        local interface GigabitEthernet0/0\r\n match identity remote address 13.64.139.188
        255.255.255.255\r\n authentication local pre-share\r\n authentication remote
        pre-share\r\n keyring local azure-keyring\r\n lifetime 28800\r\n dpd 10 5
        on-demand\r\n!\r\n!\r\n\r\n! ---------------------------------------------------------------------------------------------------------------------\r\n!
        IPSEC TRANSFORM \r\n\r\ncrypto ipsec transform-set azure-ipsec-proposal-set
        esp-aes 256 esp-sha256-hmac\r\n!\r\ncrypto ipsec profile azure-ipsec-profile-conn1\r\n
        set security-association lifetime kilobytes 102400000\r\n set transform-set
        azure-ipsec-proposal-set\r\n set ikev2-profile azure-profile-conn1\r\n!\r\n!\r\n\r\n!
        ---------------------------------------------------------------------------------------------------------------------\r\n!
        TUNNEL INTERFACE FOR ROUTEBASED ROUTING TO AZURE\r\n! Note: ''Tunnel100''
        was picked as an arbitrary interface name. \r\n!\t\tREPLACE as needed.\r\n\r\ninterface
        Tunnel100\r\n ip address LNG_BGPIP 255.255.255.254\r\n ip tcp adjust-mss 1350\r\n
        tunnel source 131.107.72.22\r\n tunnel mode ipsec ipv4\r\n tunnel destination
        13.64.139.188\r\n tunnel protection ipsec profile azure-ipsec-profile-conn1\r\n!\r\n\r\n!
        ---------------------------------------------------------------------------------------------------------------------\r\n!
        WAN INTERFACE (WHERE THE PUBLIC IP OF CISCO ISR PORT IS LOCATED)\r\n! NOTE:
        REPLACE the interface name (''GigabitEthernet0/0'') as needed.\r\n!\t\tREPLACE
        the WAN public (ISP) IP subnet as needed. In this example, it''s ''255.255.252.0'',
        denoting a /22 ISP Public IP subnet\r\n\r\ninterface GigabitEthernet0/0\r\n
        description OUTSIDE\r\n ip address 131.107.72.22 255.255.252.0\r\n duplex
        auto\r\n speed auto\r\n no cdp enable\r\n!\r\n\r\n! ---------------------------------------------------------------------------------------------------------------------\r\n!
        LAN INTERFACE (WHERE THE ONPREMISES NETWORKS ARE LOCATED)\r\n! NOTE: REPLACE
        the interface name (''GigabitEthernet0/1'') as needed.\r\n!\t\tInsert your
        LAN Port IP as well as your LAN mask below, as configured on your device.\r\n\r\ninterface
        GigabitEthernet0/1\r\n ip address \"INSERT_LAN-PORT_IP_HERE\" \"INSERT_LAN_MASK_HERE\"     \r\n
        duplex auto\r\n speed auto\r\n no cdp enable\r\n no mop enabled\r\n!\r\n\r\n!
        ---------------------------------------------------------------------------------------------------------------------\r\n!
        BGP ROUTER CONFIGURATION\r\n! NOTE: Change your LAN BGP Advertisements (under
        the IPV4 Addr Family) as needed for your tunnel\r\n\r\nrouter bgp LNG_ASN\r\n
        bgp log-neighbor-changes\r\n neighbor VNG_BGPIP remote-as VNG_ASN \r\n neighbor
        VNG_BGPIP ebgp-multihop 255\r\n neighbor VNG_BGPIP update-source Tunnel100\r\n
        !\r\n address-family ipv4\r\n  network \"INSERT LAN BGP ROUTE HERE\" mask
        \"INSERT BGP ROUTE SUBNET MASK HERE\"\r\n  network \"INSERT LAN BGP ROUTE
        HERE\" mask \"INSERT BGP ROUTE SUBNET MASK HERE\"\r\n  ! etc...\r\n  neighbor
        VNG_BGPIP activate\r\n exit-address-family\r\n!\r\nip forward-protocol nd\r\n!\r\n\r\n!
        ---------------------------------------------------------------------------------------------------------------------\r\n!
        STATIC ROUTES TO ENSURE AZURE-SPECIFIC TRAFFIC CROSSES THE TUNNEL INTERFACE
        BEFORE GETTING OUTSIDE\r\n! NOTE: UPDATE the routes as needed.\r\n!\t\tIf
        you are going through an ISP default gateway, make sure that IP is reflected
        under the general traffic going through the WAN instead (Line 1 below).\r\n\r\nip
        route 0.0.0.0 0.0.0.0 GigabitEthernet0/0 131.107.72.22\r\nip route 10.61.0.0
        255.255.0.0 Tunnel100\r\n\r\n! OPTIONAL\r\nno service-routing capabilities-manager\r\n\r\n\r\n"'
